import Head from 'next/head';

const Header = () => (
    <div>
        <Head>
            <title>Hello World</title>
            <style jsx>{`
                .nbar {
                    height: 160px !important;
                }

                body {
                    background: black !important;
                }
            `}</style>
        </Head>
    </div>
);

export default Header;
